import React from 'react';
//import {webSiteURL} from '../../../ignore/config.js';

const Login = ()=>{
    async function validateForm(){
        let username = document.getElementById('accountId').value
        let password = document.getElementById('password').value

        try{

            let fetchData = await fetch("http://localhost:3001/admin/login", {
                method: 'POST',
                mode: 'cors',
                cache: 'no-cache',
                credentials: 'same-origin',
                headers: {
                'Content-Type':'application/json'
                },
                body: JSON.stringify({username,password})
            })
            .then(res => res.json())
            console.log(fetchData)


        }catch(err){throw err} 
    }
    return(
        <div>
            <div>Asahi Admin Login</div>
	    <form name="loginForm" >
            <label>USERNAME</label>
            <input type="text" id="accountId" name="accountId" required onFocus={() =>console.log('clicked')} onBlur={() => console.log('out')} />
            <label>PASSWORD</label>
            <input type="text" id="password" name="password" required onFocus={() =>console.log('clicked')} onBlur={() => console.log('out')} />
            <input type="button" value="Login" onClick={()=> validateForm()}/>
	    </form>    
        </div>
    )
}

export default Login;
